  List<types.TextMessage> generateRandomMessages() {

    List<types.TextMessage> _messages = [];

    List<String> randomMessages = [
      "Hello! How are you?",
      "What's up?",
      "Good morning!",
      "How's it going?",
      "Are you free today?",
      "I have a question for you.",
      "Can we talk later?",
      "Did you see the game last night?",
      "How was your day?",
      "Have you heard the latest news?"
    ];

    Random random = Random();

    for (int i = 0; i < 10; i++) {
      String randomMessage = randomMessages[random.nextInt(randomMessages.length)];
      _messages.add(types.TextMessage(
        author: types.User(id: '${i % 2}'), // Alternating users for simplicity
        createdAt: DateTime.now().millisecondsSinceEpoch,
        id: 'msg$i',
        text: randomMessage,
      ));
    }
    return _messages;
  }